import React, { useState, useReducer, useEffect } from 'react'
import axios from 'axios'

function Signup() {

    const [ data, setData ] = useState({
        name: '',
        username: '',
        email: '',
        password1: '',
        password2: ''
    })

    useEffect(() => {
        console.log('register')
        const config = {
            headers: {
                'Content-Type': 'application/json'
            }
        }
        const body = JSON.stringify({ name: 'Neev', username:'neev', email:'neev@gmail.com', password1:'neev@12345' })
        axios.get('http://192.168.137.1/register', body, config)
            .then((res) => {
                console.log(res)
            })
            .catch((error) => {
                console.log(error)
            }) 
    }, [])

    const { name, username, email, password1, password2 } = data

    const onSubmit = async (e) => {
        e.preventDefault()
        if(password1 !== password2) {
            console.log('Passwords do not match')
        } else {
            const config = {
                headers: {
                    'Content-Type': 'application/json'
                }
            }
            const body = JSON.stringify({ name, username, email, password1 })

            try {
                const res = await axios.post('http://192.168.137.1/register', body, config)
                //const res = await axios.get('http://192.168.137.1/')

            } catch ( error ) {
                console.log('error')
            }

        }
    }

    return (
    <div className="form">
        <ul className="tab-group">
            <li className="tab"><a href="/">Log In</a></li>
            <li className="tab active"><a href="/signup">Sign Up</a></li>
        </ul>
        
        <div className="tab-content">
            <div id="signup">   
                <h1>Sign Up for Free</h1>
                <form  onSubmit={(e) => onSubmit(e)}>
                    <div className="top-row">
                        <div className="field-wrap">
                            <input 
                                type="text" 
                                value={name}
                                onChange={(e) => setData({ ...data, name: e.target.value })}
                                required 
                                autocomplete="off" 
                            />
                            <label>
                                Name<span class="req">*</span>
                            </label>
                        </div>
                        <div className="field-wrap">
                            <input 
                                type="text"
                                value={username}
                                onChange={(e) => setData({ ...data, username: e.target.value })}
                                required 
                                autocomplete="off"    
                            />
                            <label>
                                User Name<span className="req">*</span>
                            </label>
                        </div>
                    </div>
                    <div className="field-wrap">
                        <input 
                            type="email"
                            value={email}
                            onChange={(e) => setData({ ...data, email: e.target.value })}
                            required 
                            autocomplete="off"
                        />
                        <label>
                            Email Address<span className="req">*</span>
                        </label>
                    </div>
                
                    <div className="field-wrap">
                        <input 
                            type="password"
                            value={password1}
                            onChange={(e) => setData({ ...data, password1: e.target.value })}
                            required 
                            autocomplete="off"
                        />
                        <label>
                            Enter Password<span className="req">*</span>
                        </label>
                    </div>

                    <div className="field-wrap">
                        <input 
                            type="password"
                            value={password2}
                            onChange={(e) => setData({ ...data, password2: e.target.value })}
                            required 
                            autocomplete="off"
                        />
                        <label>
                            Confirm Password<span className="req">*</span>
                        </label>
                    </div>
                    <button type="submit" className="button button-block">Get Started</button>
                </form>
            </div>
        </div>
    </div>)
}

export default Signup;
